import React, { Component } from 'react'

export default class HumburgerIcon extends Component {
	render () { 
		return (<>
	<svg xmlns="http://www.w3.org/2000/svg" width={30} height={30} viewBox="0 0 20 20"><g id="Layer_4" data-name="Layer 4" className="dark-hide"><circle className="cls-1" cx={10} cy={10} r="5.26" /><rect className="cls-1" x="9.18" y="0.25" width="1.63" height="3.1" rx="0.82" /><rect className="cls-1" x="9.18" y="16.65" width="1.63" height="3.1" rx="0.82" /><rect className="cls-1" x="0.99" y="8.45" width="1.63" height="3.1" rx="0.82" transform="translate(-8.2 11.8) rotate(-90)" /><rect className="cls-1" x="17.38" y="8.45" width="1.63" height="3.1" rx="0.82" transform="translate(8.2 28.2) rotate(-90)" /><rect className="cls-1" x="3.39" y="2.65" width="1.63" height="3.1" rx="0.82" transform="translate(-1.74 4.2) rotate(-45)" /><rect className="cls-1" x="14.98" y="14.25" width="1.63" height="3.1" rx="0.82" transform="translate(-6.54 15.8) rotate(-45)" /><rect className="cls-1" x="3.39" y="14.25" width="1.63" height="3.1" rx="0.82" transform="translate(-4 29.94) rotate(-135)" /><rect className="cls-1" x="14.98" y="2.65" width="1.63" height="3.1" rx="0.82" transform="translate(24 18.35) rotate(-135)" /></g></svg>
		</>);
	}
}
